import Particle from './Particle.js';
import imgg from '../imgg.jpg';
import '../../App.css';

export default function About() {

  return (
      <div className="grid grid-cols-2 gap-10">
       <div className='justify-items-center grid grid-rows-3 m-10'>
        <h1 className='font-serif lg:text-8xl text-4xl font-extrabold'>
            Game
        </h1>
        <h1>Introducing a Fun and Engaging Test of Memory App</h1>
<p>Improve your memory skills and cognitive abilities with our app, featuring a variety of different memory tests and challenges. With customizable difficulty levels and easy-to-use controls, you can tailor the app to your specific needs and goals. Download today and start improving your brain power!</p>

       </div>
       <img  className="img brightness-75" src={imgg} alt="img"/>
       <Particle />
    </div>
  );
}
